INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 2, "調子が上がって\nきたなっ", 2, 3000, "訓練はまだ\nここからですわ", 1, "vo_minigame_1013_icon_2_002_001", 1000, "vo_minigame_1013_icon_1_002_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 2, "ほらほら、\nまだいけるだろ？", 2, 3000, "クスクス、悪くない\n流れですわね", 2, "vo_minigame_1013_icon_2_003_001", 5000, "vo_minigame_1013_icon_1_003_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 2, "へへっ、おまえら\nやるじゃねえか！", 2, 3000, "すばらしい\n記録ですわ", 3, "vo_minigame_1013_icon_2_004_001", 10000, "vo_minigame_1013_icon_1_004_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 3, "あたしたちはまだ\n止まらねえぜ！", 2, 3000, "乗りに乗って\nいますわね", 4, "vo_minigame_1013_icon_2_005_001", 10000, "vo_minigame_1013_icon_1_005_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 3, "見てろよ！\nマコト班の快進撃だ！", 2, 3000, "まだまだ行きます\nついてきなさい", 5, "vo_minigame_1013_icon_2_005_002", 10000, "vo_minigame_1013_icon_1_005_002");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 3, "うおぉぉっ！\n絶好調だぜ！", 2, 3000, "エリコ班の\n本領発揮ですわ！", 6, "vo_minigame_1013_icon_2_005_003", 10000, "vo_minigame_1013_icon_1_005_003");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 4, "どこまで行けるか\n楽しみだなっ！", 2, 3000, "ここからは\n前人未到の領域です！", 7, "vo_minigame_1013_icon_2_006_001", 0, "vo_minigame_1013_icon_1_006_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (4, 5, "まだ諦めんなよっ", 3, 1000, "厄介でしたわ…", 8, "vo_minigame_1013_icon_2_007_001", 1, "vo_minigame_1013_icon_1_007_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (4, 5, "冷やっとしたぜ…！", 3, 1000, "油断大敵です", 9, "vo_minigame_1013_icon_2_007_002", 1, "vo_minigame_1013_icon_1_007_002");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (4, 5, "弱音を吐くなっ", 3, 1000, "忌々しいっ…", 10, "vo_minigame_1013_icon_2_007_003", 1, "vo_minigame_1013_icon_1_007_003");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 6, "マコト班集合！", 4, 1500, "大所帯ですわね", 11, "vo_minigame_1013_icon_2_008_001", 99, "vo_minigame_1013_icon_1_008_001");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 6, "連携してくぞ！", 4, 1500, "エリコ班へようこそ", 12, "vo_minigame_1013_icon_2_008_002", 99, "vo_minigame_1013_icon_1_008_002");
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (6, 8, "みんなに力を！", 1, 3000, "ナナカちゃんに\nお任せあれ", 13, "vo_minigame_1013_icon_2_020_001", 0, "vo_minigame_1013_icon_1_020_001");
